import './App.css';
import About from "./components/About.js";
import Projects from "./components/Projects.js";

function App({currentSection}) {

  function renderSection(currentSection) {
    switch (currentSection) {
      case "About":
          return <About />
        break;
      case "Projects":
          return <Projects />
      default:
        break;
    }
  }

  return (
    <div className="App">
      <main className="App-header">
        <About />
        <Projects />
      </main>
    </div>
  );
}

export default App;
